export default function UnStart({ secondsRemaining }: any) {
  const timeLeft = getTimePeriods(secondsRemaining);
  return (
    <>
      {LIST.map((item) => (
        <Trapeziform key={item.name} borderColor="#3C3D00" corner={34} className="quest-item">
          <QuestBg $color={item.bgColor} />
          <Head>
            <HeadLeft>
              <Image src={item.logo} alt="" width={36} height={36} />
              <span className="name">{item.name}</span>
            </HeadLeft>
          </Head>
          <div style={{ textAlign: 'center' }}>
            <CardBody />
          </div>
          <div>
            <Button>
              <span className="bold">{timeLeft.days}</span> day{timeLeft.days > 0 ? 's' : ''}{' '}
              <span className="bold">{timeLeft.hours}</span> hour{timeLeft.days > 0 ? 's' : ''}
              <span className="bold">{timeLeft.minutes}</span> min{timeLeft.days > 0 ? 's' : ''}
            </Button>
          </div>
        </Trapeziform>
      ))}
      <More>More is Coming...</More>
    </>
  );
}

